import React from "react";
import Logo from "../elements/logo/Logo";
// import Sides from "../elements/Sides";
import { useNavigate } from "react-router-dom";
import "./home.css"
import admin from "../asstes/admin.png"
import staff from "../asstes/staff.png"
import homeside from "../asstes/home.png"
// import ""
let Home = () => {
    const navigate = useNavigate();

    const handleAdminClick = () => {
      navigate('/admin/login');
    };

    const handleStaffClick = () => {
      navigate('/staff/login');
    };
    return (
        <div className="home">
            <div>
                <Logo />
            </div>
            <div className="home-container">
                <div className="left">
                    <div className="side">
                        <img src={homeside} alt="Image" />
                    </div>
                    <p className="slogan">
                        <b>Your hassle free solution for creating organized schedules.</b>
                    </p>
                </div>
                <div className="right">
                    <div className="container">
                        <div className="who">
                            <p>Who are You??</p>
                        </div>
                        <div className="logins">
                            <div className="admin">
                                <div className="adminimg">
                                    <img onClick={() => navigate('')} src={admin} alt="admin" />
                                </div>
                                <p>ADMIN</p>
                            </div>
                            <div className="staff">
                                <div className="staffimg">
                                    <img src={staff} alt="admin" />
                                </div>
                                <p>STAFF</p>
                            </div>
                        </div>
                    </div>
                    <div className="curriculum">
                        <p >
                            Course Curriculum
                        </p>
                    </div>

                </div>
            </div>

        </div>

    )


}
export default Home;
